import Menu from "../components/Menu/Menu";
import Head from "next/head";

export default function Index() {
  return (
    <div>
      <Head>
        <title>It just works</title>
        <meta name="viewport" content="initial-scale=1.0, width=device-width" />
      </Head>
      <Menu />
      <h1>memesss</h1>
      <p>memes</p>
      <style jsx global>{`
        p {
          font-family: "Arial";
        }
      `}</style>
    </div>
  );
}
